import { useState } from "react";
import { registerStudent } from "../services/api";

const Register = () => {
  const [formData, setFormData] = useState({ name: "", rollNo: "", branch: "", email: "", phone: "", idCard: null });

  const handleChange = (e) => setFormData({ ...formData, [e.target.name]: e.target.value });

  const handleFileChange = (e) => setFormData({ ...formData, idCard: e.target.files[0] });

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formDataObj = new FormData();
    Object.entries(formData).forEach(([key, value]) => formDataObj.append(key, value));

    try {
      await registerStudent(formDataObj);
      alert("Registration Successful!");
    } catch (error) {
      alert("Error registering.");
    }
  };

  return (
    <div className="max-w-md mx-auto p-6 bg-white shadow-lg mt-10">
      <h2 className="text-2xl font-bold text-blue-600 mb-4">Student Registration</h2>
      <form onSubmit={handleSubmit} className="space-y-4">
        <input type="text" name="name" placeholder="Name" onChange={handleChange} className="w-full p-2 border" />
        <input type="text" name="rollNo" placeholder="Roll Number" onChange={handleChange} className="w-full p-2 border" />
        <input type="email" name="email" placeholder="Email" onChange={handleChange} className="w-full p-2 border" />
        <input type="file" name="idCard" onChange={handleFileChange} className="w-full p-2 border" />
        <button type="submit" className="bg-blue-600 text-white p-2 w-full">Register</button>
      </form>
    </div>
  );
};

export default Register;
